import React from "react";
import ListingDashboard from "./ListingDashboard";
import NavBar from "./NavBar";

const AdminPage = () => {

  return (
    <>
      <NavBar />
      <div className="flex h-screen w-full bg-blue-500">
        <div className="flex py-20 px-5 gap-20 w-full ">

          <div className="flex w-3/4 flex-col shadow-md rounded-md bg-white">
            <ListingDashboard />
          </div>
        </div>
      </div>
    </>
  );
};

export default AdminPage;
